import React, { useState, useEffect } from 'react';
import BugForm from '../components/BugForm';
import BugList from '../components/BugList';
import Button from '../components/Button';
import { getBugs, createBug, updateBug, deleteBug } from '../services/bugService';
import '../App.css';

const BugTracker = () => {
  const [bugs, setBugs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [editingBug, setEditingBug] = useState(null);

  useEffect(() => {
    loadBugs();
  }, []);

  const loadBugs = async () => {
    try {
      setLoading(true);
      setError(null);
      const response = await getBugs();
      // Ensure we always have an array, even if response structure is different
      const bugsArray = response?.bugs || response || [];
      setBugs(Array.isArray(bugsArray) ? bugsArray : []);
    } catch (err) {
      console.error('Error loading bugs:', err);
      setError('Failed to load bugs. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleCreateBug = async (bugData) => {
    try {
      await createBug(bugData);
      setShowForm(false);
      await loadBugs(); // Reload the list
    } catch (err) {
      console.error('Error creating bug:', err);
      throw new Error('Failed to create bug. Please try again.');
    }
  };

  const handleUpdateBug = async (bugId, bugData) => {
    try {
      await updateBug(bugId, bugData);
      setEditingBug(null);
      await loadBugs(); // Reload the list
    } catch (err) {
      console.error('Error updating bug:', err);
      throw new Error('Failed to update bug. Please try again.');
    }
  };

  const handleDeleteBug = async (bugId) => {
    if (window.confirm('Are you sure you want to delete this bug?')) {
      try {
        await deleteBug(bugId);
        await loadBugs(); // Reload the list
      } catch (err) {
        console.error('Error deleting bug:', err);
        setError('Failed to delete bug. Please try again.');
      }
    }
  };

  const handleEditBug = (bug) => {
    setEditingBug(bug);
    setShowForm(true);
  };

  const handleCancelForm = () => {
    setShowForm(false);
    setEditingBug(null);
  };

  return (
    <div className="App">
      <header className="header">
        <div className="container">
          <h1>üêõ MERN Bug Tracker</h1>
          <p>Track, manage, and resolve bugs efficiently</p>
        </div>
      </header>

      <main className="container">
        {error && (
          <div className="error-message submit-error">
            {error}
            <Button 
              variant="secondary" 
              size="sm" 
              onClick={() => setError(null)}
              style={{ marginLeft: '1rem' }}
            >
              Dismiss
            </Button>
          </div>
        )}

        <div className="actions-bar">
          <Button
            variant="primary"
            onClick={() => setShowForm(!showForm)}
          >
            {showForm ? 'üìã View Bugs' : 'üêõ Report New Bug'}
          </Button>
          
          <Button
            variant="secondary"
            onClick={loadBugs}
            disabled={loading}
          >
            üîÑ Refresh
          </Button>
        </div>

        {showForm ? (
          <div className="form-section">
            <h2>{editingBug ? 'Edit Bug' : 'Report New Bug'}</h2>
            <BugForm
              onSubmit={editingBug ? 
                (data) => handleUpdateBug(editingBug._id, data) : 
                handleCreateBug
              }
              initialData={editingBug || {}}
              isEditing={!!editingBug}
              onCancel={handleCancelForm}
            />
          </div>
        ) : (
          <div className="list-section">
            <h2>Bug Reports ({bugs.length})</h2>
            {loading ? (
              <div className="loading">Loading bugs...</div>
            ) : (
              <BugList
                bugs={bugs}
                onEdit={handleEditBug}
                onDelete={handleDeleteBug}
              />
            )}
          </div>
        )}
      </main>
    </div>
  );
};

export default BugTracker;
